import React from 'react';
import { Container } from 'react-bootstrap';

const About = () => {
    return (
        <div>
            <Container>
                <div className="text-center pt-5 pb-5">
                    <h3>About Us</h3>

                    <p>Federal healthcare confidently and capably provides comprehensive health care with 
                    the latest medical, surgical and diagnostic equipment and facilities. 
                    These services are provided by expert medical professionals, skilled nurses and 
                    technologists using state-of- the-art technology.</p>

                    <p>Federal healthcare is an eleven storey building built on one acre of land, and has 
                    120,000 square feet of total floor space.Federal healthcare has all the characteristics 
                    of a world-class hospital with a wide range of services and a diversity of specialists, 
                    equipment and technology. The Hospital showcases a synergy of medical technology and
                     advances in IT through paperless medical records. The skilled nurses, technologists and 
                     administrators of Federal healthcare, aided by state-of- the-art equipment, 
                     provide a congenial infrastructure for the medical professionals in providing healthcare to 
                     international standards.</p>

                </div>
            </Container>
        </div>
    );
};

export default About;
